import React, { Component } from 'react'


class Compare extends Component{

    displayData = () =>{
        if(this.props.data){
            console.log('mydata', this.props.data)
            this.props.data.forEach((post)=>{
                return(<h1>{post.id}</h1>)
            })
        }
    }

    render(){


        return(
            <div>
                    {this.displayData()}
        </div>
        )
    }
}

export default Compare
